import { Component, OnInit } from '@angular/core';
import { AssociazioneInterventoCe } from '../classes-services/classes/associazione-intervento-ce';
import { AssociazioneInterventoSt } from '../classes-services/classes/associazione-intervento-st';
import { AssociazioneRiepilogo } from '../classes-services/classes/associazione-riepilogo';
import { AssociazioneRiepilogoService } from '../classes-services/services/associazione-riepilogo.service';
import { registerLocaleData } from '@angular/common';

import localeFr from '@angular/common/locales/fr';
registerLocaleData(localeFr, 'fr');

import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-riepilogo-combinato-st',
  templateUrl: './riepilogo-combinato-st.component.html',
  styleUrls: ['./riepilogo-combinato-st.component.css']
})
export class RiepilogoCombinatoStComponent implements OnInit {

  constructor(
    private service: AssociazioneRiepilogoService
  ) { }

  interventi: AssociazioneInterventoSt[] = []
  soglia: number
  vulClass: number
  risk: number
  punteggio: number
  punteggioDiVul: number
  vulClassAggiornata: number
  totale: number
  prezzoParziale = []
  interventoSelezionato: number
  associazione: AssociazioneRiepilogo[]
  somma: number
  prezzoStrutturale: number
  prezzoEnergetico: number
  interventoEnergetico: AssociazioneInterventoCe
  interv: AssociazioneInterventoCe[] = []
  associazioneSelezionati: AssociazioneRiepilogo[] = []
  risparmioEuro: number
  costoIntegrato: number
  risparmioPercentuale: number
  attrezzature: string
  showDiv: boolean = true
  elementoSelezionato = []
  dimensioneInput: number
  prezzoStrutturaleVisualizz: number
  prezzoEnergeticoVisualizz: number
  risparmioEuroVisualizz: number
  sommaVisualizz: number
  costoIntegratoVisualizz: number
  interventiAssociatiPdf = []
  costoDiRiparazione: number
  visualizzaRighe: number
  showButton: boolean = false
  nomeCosto: string
  packCostiIntegrati = []
  packInterventiStrutturali = []
  packInterventiEnergetici = []
  packDescrizioneEnergetico = []
  stringaEnergetico: string
  stringaStrutturale: string
  stringaDescrizioneEnergetico: string
  totaleIntegrati: number
  sommaIntegrati: number
  selezionati = []
  sommaSelezionati: number
  listaStrutturali = [] 
  alarm: boolean = false
  nomeInterventoIntegrato: string
  packNomeInterventoIntegrato = []
  packRisparmio = []
  sommaRisparmi: number
  risparmioPdf: number

  ngOnInit() {
    this.interventi = window.history.state.interventi
    this.soglia = window.history.state.soglia
    this.vulClass = window.history.state.vulClass
    this.risk = window.history.state.risk;
    this.punteggio = window.history.state.punteggio
    this.punteggioDiVul = window.history.state.punteggioDiVul
    this.vulClassAggiornata = window.history.state.vulClassAggiornata
    this.totale = window.history.state.totale
    this.prezzoParziale = window.history.state.prezzoParziale
    this.costoDiRiparazione = window.history.state.costoDiRiparazione
    this.visualizzaRighe = window.history.state.visualizzaRighe
    this.nomeCosto = window.history.state.nomeCosto
    this.listaStrutturali = window.history.state.listaStrutturali
    if(this.nomeCosto == undefined) {
      this.nomeCosto = "null"
    }
    if(this.totaleIntegrati == undefined) {
      this.totaleIntegrati = 0
    }
    if(this.sommaRisparmi == undefined) {
      this.sommaRisparmi = 0
    }
    this.service.getAssociazioneRiepilogo().subscribe(data => {
      this.associazione = data
      this.interventi.forEach(c => {
        this.associazione.forEach(d => {
          if(c.id == d.associazioneInterventoStrutturale.id) {
            this.interventiAssociatiPdf.push(d)
          }
        })
      })
    })
  }

  mostra() {
    this.showDiv = false;
  }

  onChangeIntervento(intervento: number) {
    this.alarm = false
    this.prezzoStrutturale = intervento
    this.elementoSelezionato = []
    if(this.prezzoStrutturale != 0) {
      this.interventi.forEach(c => {
        if(this.prezzoStrutturale == c.prezzoRiepilogo) {
          this.elementoSelezionato.push(c)
        } 
        if(this.prezzoStrutturale == c.prezzoRiepilogoDue) {
          this.elementoSelezionato.push(c)
        }
      })
    } else {
      this.elementoSelezionato.push(0)
    }
    
    this.elementoSelezionato.forEach(a => {
      this.interventoSelezionato = a.id
    })
    this.associazioneSelezionati = []
    this.associazione.forEach(t => {
      if(this.interventoSelezionato == t.associazioneInterventoStrutturale.id) {
        this.associazioneSelezionati.push(t)
      }
    })
    this.interventoEnergetico = null
    this.interv = []
    this.associazioneSelezionati.forEach(d => {
      this.interventoEnergetico = d?.associazioneInterventoEnergetico
      this.interv.push(this.interventoEnergetico)
      this.nomeInterventoIntegrato = d.associazioneInterventoStrutturale.intervento.codice
    })
    if(this.interventoEnergetico == null) {
      this.alarm = true
    }
    this.showDiv = true
    this.showButton = false
  }

  onChangeEnergetico(interventoEn: number) {
    this.prezzoEnergetico = interventoEn
    this.associazioneSelezionati.forEach(c => {
      if(this.prezzoEnergetico == c.associazioneInterventoEnergetico.prezzoRiepilogo) {
        this.stringaStrutturale = c.associazioneInterventoStrutturale.intervento.codice
        this.stringaEnergetico = c.associazioneInterventoEnergetico.intervento.codice
        this.stringaDescrizioneEnergetico = c.associazioneInterventoEnergetico.intervento.descrizione
        this.risparmioEuro = c.risparmioEuro
        this.attrezzature = c.attrezzature
      }
    })
    this.showDiv = true
    this.showButton = true
  }


  calcolaSomma() {
    this.prezzoStrutturaleVisualizz = Number(this.prezzoStrutturale) * this.dimensioneInput
    this.prezzoEnergeticoVisualizz = Number(this.prezzoEnergetico) * this.dimensioneInput
    this.sommaVisualizz = this.prezzoStrutturaleVisualizz + this.prezzoEnergeticoVisualizz
    this.risparmioEuroVisualizz = this.risparmioEuro * this.dimensioneInput
    this.costoIntegratoVisualizz = this.sommaVisualizz - this.risparmioEuroVisualizz
    this.risparmioPercentuale = (this.risparmioEuroVisualizz * 100) / this.sommaVisualizz

    this.somma = Number(this.prezzoStrutturale) + Number(this.prezzoEnergetico)
    this.costoIntegrato = this.somma - this.risparmioEuro
  }

  salvaCosti() {
    this.packCostiIntegrati.push(this.costoIntegratoVisualizz)
    this.packInterventiStrutturali.push(this.stringaStrutturale)
    this.packInterventiEnergetici.push(this.stringaEnergetico)
    this.packDescrizioneEnergetico.push(this.stringaDescrizioneEnergetico)
    this.packNomeInterventoIntegrato.push(this.nomeInterventoIntegrato)
    this.packRisparmio.push(this.risparmioEuroVisualizz)
  }

  calcolaCostoConIntegrati() {
    const sommaIntegrati = this.packCostiIntegrati.reduce((a,b) => a+b, 0)
    this.sommaIntegrati = sommaIntegrati

    const selezionati = this.selezionati.reduce((a,b) => a+b, 0)
    this.sommaSelezionati = selezionati

    const sommaRisparmi = this.packRisparmio.reduce((a,b) => a+b, 0)
    this.sommaRisparmi = sommaRisparmi
    
    this.totaleIntegrati = this.sommaIntegrati + this.sommaSelezionati
  }

  onCheck(selez) {
    if(!this.selezionati.includes(selez)) {
      this.selezionati.push(selez)
    } else {
      var index = this.selezionati.indexOf(selez)
      if(index > -1) {
        this.selezionati.splice(index, 1)
      }
    }
  }

  generatePdf(){
    if(this.sommaRisparmi != 0) {
      this.risparmioPdf = this.totaleIntegrati - this.sommaRisparmi
    } else {
      this.risparmioPdf = 0
    }
    const documentDefinition = this.getDocumentDefinition()
    pdfMake.createPdf(documentDefinition).open()
  }

  getDocumentDefinition() {

    const config = {
      table: {
        headerRows: 1,
        widths: ['*','*','*','*'],
        body: [
        ['Interventi Strutturali', 'Interventi Energetici', 'Descrizione Interventi Energetici', 'Prezzo Interventi Integrati'],
        ]
      }
    };

    for(let i = 0; i < this.packInterventiStrutturali.length; i++) {
      const newRow = [];
      newRow.push(!!this.packInterventiStrutturali[i] ? this.packInterventiStrutturali[i] : "");
      newRow.push(!!this.packInterventiEnergetici[i] ? this.packInterventiEnergetici[i] : "");
      newRow.push(!!this.packDescrizioneEnergetico[i] ? this.packDescrizioneEnergetico[i] : "");
      newRow.push(!!this.packCostiIntegrati[i] ? this.packCostiIntegrati[i].toFixed(2) + 'â‚¬' : "");
      config.table.body.push(newRow)
    }

    return {

      content: [

        //IMMAGINE
        {
          image:'data:image/png;base64,',
          width: 100,
          alignment: 'center'
        },

        //TITOLO
        {text: 'Riepilogo Valutazione Strutturale\n\n', style: 'header', bold:'true', fontSize: 20, alignment: 'center'},

        {
          style: 'tableExample',
          table: {
            widths: ['*','*'],
            headerRows: 1,
            body: [
              [{text: 'Valutazione Ante Operam', style: 'tableHeader', bold:'true', alignment:'center'}, 
              {text: 'Valutazione Post Operam', style: 'tableHeader', bold:'true', alignment:'center'}],
              [
                [
                  {
                    table: {
                      widths: ['*', 'auto'],
                      body: [
                        ['Classe di vulnerabilitÃ ', 'V' + this.vulClass],
                        ['Totale punteggio', this.punteggio],
                        ['Classe di rischio sismico', this.risk]
                      ]
                    }
                  }
                
                ],
                [
                  {
                    table: {
                      widths: ['*', 'auto'],
                      body: [
                        ['Classe di vulnerabilitÃ ', 'V' + this.vulClassAggiornata],
                        ['Totale punteggio', this.punteggioDiVul],
                        ['Classe di rischio sismico', this.risk]
                      ]
                    }
                  }
                ]
              ]
              
            ]
          }
        },
        
        //INTERVENTI
        {text: '\n\nInterventi Strutturali previsti\n\n', style: 'header', bold:'true', fontSize: 15, alignment: 'center'},
        
        //TABELLA INTERVENTI
        {
          table: {
            headerRows: 1,
            widths: ['auto', '*', 100],
            body: [
              ['Codice', 'Descrizione', 'Costo parziale'],
              ...this.interventi.map((intervObj, index) => 
                  [intervObj.intervento.codice, intervObj.intervento.descrizione, this.prezzoParziale[index].toFixed(2) + 'â‚¬']
              )
            ]
          }
        },
  
        //TOTALE
        {
          style: 'tableExample',
          table: {
            widths: ['*', 100],
            body: [
              [{text: 'Costo di investimento totale', bold:'true'}, this.totale.toFixed(2) + 'â‚¬']
            ]
          }
        },

        {text:'\n\n'},
        //TOTALE DANNI
        {
          style: 'tableExample',
          table: {     
            widths: ['*', 100],
            body: [
              ['Livello di danno ipotizzato', this.nomeCosto],
              ['Ipotesi costo di riparazione', this.costoDiRiparazione.toFixed(2) + 'â‚¬']
            ]
          }
        },

        //INTEGRAZIONI POSSIBILI
        {text: '\n\nIntegrazione con Interventi Energetici\n\n', 
        style: 'header', 
        bold:'true', 
        fontSize: 15, 
        alignment: 'center'},

        {
          columns: [
            { width:'*', text:''},
            {
              width:'100',
              table: {
                body: [
                  ['Prezzo Interventi non Integrati'],
                  [
                    this.selezionati.map(function(item) {
                      return item.toFixed(2) + 'â‚¬'
                    })
                ]
                ]
              }
            }
          ]
        },
        
        {text:'\n\n'},
        /*
        {content: [config]},
        */
        
        {
          style: 'tableExample',
          unbreakable: true,
          table: {
            headerRows: 1,
            widths: ['auto', 'auto', 'auto', 100],
            body: [
              ['Interventi Strutturali', 'Interventi Energetici','Descrizione Interventi Energetici','Prezzo Interventi Integrati'],
              [
              this.packInterventiStrutturali.map(function(item) {
                return item
              }),
              this.packInterventiEnergetici.map(function(item) {
                return item
              }),
              this.packDescrizioneEnergetico.map(function(item) {
                return item
              }),
              this.packCostiIntegrati.map(function(item) {
                return item.toFixed(2) + 'â‚¬'
              })
            ]
            ]
          }
        },
        

        {text:'\n\n'},
        //TOTALE
        {
          style: 'tableExample',
          table: {
            widths: ['*', 100],
            body: [
              [{text:'Costo di investimento totale con integrazioni', bold:'true'}, this.totaleIntegrati.toFixed(2) + 'â‚¬'],
              [{text:'Risparmio rispetto ad azioni disgiunte', bold:'true'}, this.sommaRisparmi.toFixed(2) + 'â‚¬']
            ]
          }
        }
      ]
    }
  }
  
 
}
